import React, { Component } from 'react';

import Picture from '../images/profile.jpg'

class ProfileImage extends Component {
    render() {
        return (
            <div>
                <div class="container">
                <img src={Picture} alt="Profile Picture"/>
                <p></p>
                </div>
            </div>
        )
    }
}

export default ProfileImage;
